import React from 'react'

function Contact() {
  return (
    <div id='contact'>
        <h1> Nous Contacter</h1>
        <form>
            <input type='text' placeholder='Votre nom' />
            <input type='email' placeholder='Votre email' />

        </form>
    </div>
  )
}

export default Contact
